import './productlist.css';

import React from 'react';

import ProductImg from '../../../assets/imgs/desktop1.avif';

const productslist= ()=>{
    return(
        
        <div className='productlist-container'>
            <div className='container'>
                <h2>Aqui encontraras todos los que te interesan</h2>
                <div className='listing-container'>
                    <div className='product-card'>
                     <div className='product-listing-img'>
                        <img src={ProductImg} alt='product-listing-img' className='prod'></img>

                     </div>
                     <div className='prodcut-listing-details'>
                       <h3>Nombre Producto</h3>
                       <p></p>
                       <p>Precio</p>
                       <a href='#'>Button</a>
                     </div>
                    </div>

                </div>
            </div>

           
        </div>
    )
}
export default productslist;
